import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Scorebutton(props) {
  return(
    <button className="scorebutton">
      {props.value}
    </button>
  );
}

class Scorebar extends React.Component {
  render() {
     return(
        <div>
          <Scorebutton
             value="2"
          />
	</div>
     );
  }
}
ReactDOM.render(
   <Scorebar />,
   document.getElementById('root')
);
